import React, { useState } from "react";

function Main(props) {
  const containers = ["Top shelf", "Middle shelf", "Lower shelf"];
  return (
    <>
      <h1>My Fridge</h1>
      <ul>
        {props.containers.map((container) => (
          <li>{container}</li>
        ))}
      </ul>
    </>
  );
}

function Product() {
  return (
    <>
      <h1>Insert product here</h1>
      <input type="text" />
      <h1>Product type</h1>
      <input type="text" />
      <h1>Best before date</h1>
      <input type="date" />
      <h1>Use by date</h1>
      <input type="date" />

      <button>Add Product</button>
      <button>Remove Product</button>
    </>
  );
}
export default Main();
